import Navbar from "../components/Navbar";

const numbers = [1, 2, 3, 4 ,5]

function Home(){
    return (
        <div>
            <Navbar />
            {numbers.map(number => (
                <p key={number}>{number}</p>
            ))}
        </div>
    );
}

export default Home;
